import './App.css';
import Logo from './components/logo';

function App() {
  return (
    <div className='App'>
      <header className='App-header'>
        <Logo></Logo>
        <ul>
          <li className='opcoes'><p>Projetos</p></li>
          <li className='opcoes'><p>Esquequi</p></li>
        </ul>
      </header>
      <h2 className='texto_construcao'>Em construção</h2>
    </div>
  );
}

export default App;
